import img from 'react';

const Book = ({ book }) => {
    console.log({book})
    return (
        <div>
            <img src={book.imageLinks.smallThumbnail} alt={book.title}/>
            <p className="book-title">{book.title}</p>
            <p className="book-authors">{book.authors}</p>
        </div>
    )
}

export default Book;
